package user;import hello.yoonmin.grpc.User;import hello.yoonmin.grpc.userGrpc;import io.grpc.stub.StreamObserver;public class UserService extends userGrpc.userImplBase {	@Override	public void login(User.LoginRequest request, StreamObserver<User.APIResponse> responseObserver) {		System.out.println("Start Login API");		String username = request.getUsername();		String password = request.getPassword();		System.out.println("username = " + username + ", password = " + password);		User.APIResponse.Builder builder = User.APIResponse.newBuilder();		if (username.equals(password)) {			builder.setResponseCode(200).setResponsemessage("SUCCESS");		} else {			builder.setResponseCode(401).setResponsemessage("FAIL");		}		responseObserver.onNext(builder.build());		responseObserver.onCompleted();		System.out.println("END Login API");	}	@Override	public void logout(User.Empty request, StreamObserver<User.APIResponse> responseObserver) {		super.logout(request, responseObserver);	}}